import Vue from "vue";
import Vuex from "vuex";

import settings from "./modules/settings";

Vue.use(Vuex);

export default new Vuex.Store({
  // state: {},
  // mutations: {},
  // actions: {},
  modules: {
    settings,
    dashboard,
    payments,
    bills,
    notifications,
    meters,
    vehicleRequests,
    supports
  }
});
